will.setInformation('../../assets/trener3.jpg', 'Trener sztuk walki', 'Dostawiając codziennie jedną idealnie położoną cegłę, po jakimś czasie już masz cały, solidny mur', 'In hac habitasse platea dictumst. Vivamus sit amet sapien rutrum, sodales enim sit amet, tincidunt arcu. Duis placerat risus quam, eget pellentesque eros malesuada non.');


export default { CoachesArray };
